import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { useState } from 'react';
import NavBar from './components/NavBar';
import Footer from './components/Footer';
import LandingPage from './pages/LandingPage';
import InputPage from './pages/InputPage';
import ResultsPage from './pages/ResultsPage';
import ChatPage from './pages/ChatPage';
import SettingsDrawer from './components/SettingsDrawer';

function App() {
  const [isSettingsOpen, setIsSettingsOpen] = useState(false);
  const [language, setLanguage] = useState<'EN' | 'KA'>('EN');
  const [glowIntensity, setGlowIntensity] = useState(50);
  const [apiKey, setApiKey] = useState<string>('sk-proj-  hPcA');
  const [scanData, setScanData] = useState<{
    type: 'image' | 'text';
    content: string;
    file?: File;
  } | null>(null);

  return (
    <Router>
      <div className="min-h-screen bg-background text-foreground flex flex-col">
        <NavBar 
          language={language}
          onLanguageToggle={() => setLanguage(prev => prev === 'EN' ? 'KA' : 'EN')}
          onSettingsClick={() => setIsSettingsOpen(true)}
        />
        
        <main className="flex-1">
          <Routes>
            <Route path="/" element={<LandingPage />} />
            <Route 
              path="/input" 
              element={<InputPage onScanComplete={setScanData} />} 
            />
            <Route 
              path="/results" 
              element={<ResultsPage scanData={scanData} apiKey={apiKey} />} 
            />
            <Route 
              path="/chat" 
              element={<ChatPage apiKey={apiKey} />} 
            />
          </Routes>
        </main>
        
        <Footer />
        
        <SettingsDrawer
          isOpen={isSettingsOpen}
          onClose={() => setIsSettingsOpen(false)}
          language={language}
          onLanguageChange={setLanguage}
          glowIntensity={glowIntensity}
          onGlowIntensityChange={setGlowIntensity}
          apiKey={apiKey}
          onApiKeyChange={setApiKey}
        />
      </div>
    </Router>
  );
}

export default App;
